                do {
                    aidPackage.aidPackageItems.push(aidPackageItem);
                };
            }

            error? e = dbClient.close();
            if e is error {
                return {"aidPackages": aidPackages}.toJson();
            }
        }
        return {"aidPackages": aidPackages}.toJson();
    }

